import React from "react";
import {Button} from "@mui/material";

const outline = {
    display:'flex',
    justifyContent:'space-between',
    height: 100,
    backgroundColor: 'snow',
    minWidth:'1024px',
}

const style = {
    textAlign: "right",
    paddingRight: 100,
    lineHeight:3,
    fontSize: 30,

}

const style2 = {
    textAlign: "left",
    fontSize: 30,
    paddingLeft: 100,
    lineHeight:3,

}
const right = {
    display: "block",
};
const right2 = {
    display: "block",
    margin: '0 10px'
};

const headerSame = {
    justifyContent: "right",
    display: "flex",
    flexGrow : 2
};


const Header = () => {
    return (
        <div style={outline}>
            <div style={headerSame}>
                <div style={right}>
                    <Button variant="contained" href="../" color="success">TopPage</Button>
                </div>
                <div style={right2}>
                    <Button variant="contained" href="../Form" color="secondary">FormPage</Button>
                </div>
                <div style={right2}>
                    <Button variant="contained" href="../Question" color="secondary">QuestionIndex</Button>
                </div>
            </div>
        </div>
    )
}

export default Header;
